function dx = gmcsf_shp2_example(t,x,p,IL6stim,GMCSFstim, varargin)
   % Model:   JakStatMapk
   % Species:
   %   x(01) --> GMCSF
   %   x(02) --> GMCSF_RC
   %   x(03) --> GMCSF_LRC
   %   x(04) --> GMCSF_LRC_SHP2
   %   x(05) --> IL6
   %   x(06) --> IL6_RC
   %   x(07) --> IL6_LRC
   %   x(08) --> IL6_LRC_SHP2
   %   x(09) --> STAT3
   %   x(10) --> pSTAT3
   %   x(11) --> pSTAT3_nuc
   %   x(12) --> SHP2
   %   x(13) --> pSHP2
   %   x(14) --> uERK
   %   x(15) --> pERK
   %   x(16) --> pERK_nuc
   %   x(17) --> SOCS3_mRNA
   %   x(18) --> SOCS3
   %   x(19) --> IL6_LRC_SOCS3
   %   x(20) --> GMCSF_LRC_SOCS3
   %   x(21) --> inhibix
   dx = zeros(21,1);
   dx(01) =   + p(01)  - p(03)*x(01)*x(02)                                                                                                                                                                  ;  % GMCSF
   dx(02) =   - p(03)*x(01)*x(02)  + p(17)*x(03)*x(13)  + p(17)*x(04)*x(13)                                                                                                                                 ;  % GMCSF_RC
   dx(03) =   + p(03)*x(01)*x(02)  - p(05)*x(03)*x(12)  + p(07)*x(04)  - p(11)*x(03)*x(18)  - p(17)*x(03)*x(13)                                                                                             ;  % GMCSF_LRC
   dx(04) =   + p(05)*x(03)*x(12)  - p(07)*x(04)  - p(17)*x(04)*x(13)                                                                                                                                       ;  % GMCSF_LRC_SHP2
   dx(05) =   + p(02)  - p(04)*x(05)*x(06)                                                                                                                                                                  ;  % IL6
   dx(06) =   - p(04)*x(05)*x(06)  + p(17)*x(07)*x(13)  + p(17)*x(08)*x(13)  + p(20)*x(21)*x(07)  + p(20)*x(21)*x(08)                                                                                       ;  % IL6_RC
   dx(07) =   + p(04)*x(05)*x(06)  - p(05)*x(07)*x(12)  + p(06)*x(08)  - p(11)*x(07)*x(18)  - p(17)*x(07)*x(13)  - p(20)*x(21)*x(07)                                                                        ;  % IL6_LRC
   dx(08) =   + p(05)*x(07)*x(12)  - p(06)*x(08)  - p(17)*x(08)*x(13)  - p(20)*x(21)*x(08)                                                                                                                  ;  % IL6_LRC_SHP2
   dx(09) =   - p(12)*(x(07) + x(08))*x(09)  + p(14)*x(11)  + p(15)*x(11)  + 0010*p(17)*x(10)*x(13)  - p(21)*(x(03) + x(04))*x(09)                                                                          ;  % STAT3
   dx(10) =   + p(12)*(x(07) + x(08))*x(09)  - p(13)*x(10)  - 0010*p(17)*x(10)*x(13)  + p(21)*(x(03) + x(04))*x(09)                                                                                         ;  % pSTAT3
   dx(11) =   + p(13)*x(10)  - p(14)*x(11)  - p(15)*x(11)                                                                                                                                                   ;  % pSTAT3_nuc
   dx(12) =   - p(05)*x(07)*x(12)  - p(05)*x(03)*x(12)  + 0010*p(17)*x(10)*x(13)  + p(17)*x(07)*x(13)  +2*p(17)*x(08)*x(13)  + p(17)*x(03)*x(13)  +2*p(17)*x(04)*x(13)  + p(18)*x(13)  + p(20)*x(21)*x(08)  ;  % SHP2
   dx(13) =   + p(06)*x(08)  + p(07)*x(04)  - 0010*p(17)*x(10)*x(13)  - p(17)*x(07)*x(13)  - p(17)*x(08)*x(13)  - p(17)*x(03)*x(13)  - p(17)*x(04)*x(13)  - p(18)*x(13)                                     ;  % pSHP2
   dx(14) =   - p(08)*(x(04) + x(08))*x(14)  + p(10)*x(16)                                                                                                                                                  ;  % uERK
   dx(15) =   + p(08)*(x(04) + x(08))*x(14)  - p(09)*x(15)                                                                                                                                                  ;  % pERK
   dx(16) =   + p(09)*x(15)  - p(10)*x(16)                                                                                                                                                                  ;  % pERK_nuc
   dx(17) =   + p(15)*x(11)  - p(16)*x(17)                                                                                                                                                                  ;  % SOCS3_mRNA
   dx(18) =   - p(11)*x(07)*x(18)  - p(11)*x(03)*x(18) +10*p(16)*x(17)                                                                                                                                      ;  % SOCS3
   dx(19) =   + p(11)*x(07)*x(18)                                                                                                                                                                           ;  % IL6_LRC_SOCS3
   dx(20) =   + p(11)*x(03)*x(18)                                                                                                                                                                           ;  % GMCSF_LRC_SOCS3
   dx(21) =   - p(19)*(x(03) + x(04))*x(21)                                                                                                                                                                 ;  % inhibix
end   % end of function
